import React, { Component } from 'react';

export default class Api extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: {},
        };
        this.url = 'https://randomuser.me/api/?results=10';
    }

    componentDidMount() {}

    getData(url) {
        fetch(url)
            .then(data => data.json())
            .then(res => {
                this.setState({
                    data: res,
                });
            })
            .catch(error => console.log(error));
    }

    render() {
        console.log(this.state.data);
        return <p></p>;
    }
}
